    public class CrystalCavee : ModWorld
    {
        public override void ModifyWorldGenTasks(List<GenPass> tasks, ref float totalWeight)
        {
            int livingTreesIndex = tasks.FindIndex(genpass => genpass.Name.Equals("Remove Water From Sand"));
            tasks.TryInsert(livingTreesIndex, new PassLegacy("Post Terrain", MakeCrystalCaves));
        }

        private void MakeCrystalCaves(GenerationProgress progress)
        {



            progress.Message = "Crystallizing the Caverns";
            int numberToGenerate = 1;

            for (int k = 0; k < numberToGenerate; k++)
            {
                bool success = false;
                int attempts = 0;

                while (!success)
                {
                    attempts++;
                    if (attempts > 1000)
                    {
                        success = true;
                        continue;
                    }



                    int i = WorldGen.genRand.Next(300, Main.maxTilesX / 3);
                    int j = (int)Main.worldSurface - 200;


                    while (!WorldGen.SolidTile(i, j) && j <= Main.worldSurface)
                    {
                        j++;
                        continue;
                    }
                    bool placementOK = true;

                    for (int l = i - 40; l < i + 40; l++)
                        for (int m = j - 18; m < j + 21; m++)
                        {
                            int type = Main.tile[l, m].type;
                            if (type == TileID.BlueDungeonBrick || type == TileID.GreenDungeonBrick || type == TileID.PinkDungeonBrick ||
                                type == TileID.Cloud || type == TileID.RainCloud || type == 368 || type == 367 || type == 226)
                                placementOK = false;
                        }

                    if (placementOK)

                        success = PlaceCrystalCave(i, j);
                }
            }

            int ShrineAmount = WorldGen.genRand.Next(7, 13);
            while (ShrineAmount >= 0)
            {
                int x = WorldGen.genRand.Next(Main.maxTilesX);
                int y = WorldGen.genRand.Next(Main.maxTilesY);
                while (Framing.GetTileSafely(x, y).type != ModContent.TileType<CavernStone>())
                {
                    x = WorldGen.genRand.Next(Main.maxTilesX);
                    y = WorldGen.genRand.Next(Main.maxTilesY);
                }
                int[] commonItems = { ItemID.CopperBar, ItemID.IronBar, ItemID.TinBar, ItemID.LeadBar };
                int[] ammo_common = { ItemID.WoodenArrow, ItemID.Shuriken };
                int[] potions_uncommon = { ItemID.SwiftnessPotion, ItemID.IronskinPotion, ItemID.ShinePotion, ItemID.NightOwlPotion, ItemID.ArcheryPotion, ItemID.HunterPotion, ModContent.ItemType<MiningSack>() };
                int recall_bruh = ItemID.RecallPotion;
                int[] potionsevil_rare = WorldGen.crimson == false ? new int[] { ItemID.WrathPotion } : new int[] { ItemID.RagePotion, ItemID.HeartreachPotion }; ;
                int[] other1_common = { ItemID.HerbBag, ItemID.Grenade };
                int[] other2_common = { ItemID.Bottle, ItemID.Torch };
                int[] rare = { ModContent.ItemType<CrystalStompers>(), ItemID.MagicMirror, ItemID.CloudinaBottle, ModContent.ItemType<PagesOfDawn>(), ItemID.WandofSparking };
                int[] rare_Weapons = { ModContent.ItemType<CrystalGrowingKit>(), ModContent.ItemType<CrystalKunai>(), ModContent.ItemType<ShiningShooter>(), ModContent.ItemType<DiamondDuster>(), ModContent.ItemType<CrystallizedBlade>() };
                WorldUtils.Gen(new Point(x, y - 5), new Shapes.Rectangle(10, 17), new Actions.ClearTile());
                WorldUtils.Gen(new Point(x, y), new Shapes.Rectangle(10, 2), new Actions.SetTile((ushort)ModContent.TileType<GlimmerwoodTile>()));
                WorldUtils.Gen(new Point(x, y + 1), new Shapes.Rectangle(1, 1), new Actions.SetSlope(4));
                WorldUtils.Gen(new Point(x + 9, y + 1), new Shapes.Rectangle(1, 1), new Actions.SetSlope(3));
                WorldUtils.Gen(new Point(x + 1, y - 5), new Shapes.Rectangle(1, 5), new Actions.SetTile((ushort)ModContent.TileType<GlimmerwoodBeam>()));
                WorldUtils.Gen(new Point(x + 8, y - 5), new Shapes.Rectangle(1, 5), new Actions.SetTile((ushort)ModContent.TileType<GlimmerwoodBeam>()));
                WorldUtils.Gen(new Point(x, y - 6), new Shapes.Rectangle(10, 2), new Actions.SetTile((ushort)ModContent.TileType<GlimmerwoodTile>()));
                int chestIndex = WorldGen.PlaceChest(x + 4, y - 1, type: (ushort)ModContent.TileType<CavernChest>(), false);

                if (chestIndex != -1)
                {
                    Chest chest = Main.chest[chestIndex];
                    var itemsToAdd = new List<(int type, int stack)>();
                    int RandRare = rare_Weapons[WorldGen.genRand.Next(0, rare_Weapons.Length)];
                    int specialItem = new Terraria.Utilities.WeightedRandom<int>(
                        Tuple.Create((int)rare[WorldGen.genRand.Next(0, rare.Length)], .1),
                        Tuple.Create(rare[WorldGen.genRand.Next(0, rare.Length)], .7),
                        Tuple.Create(potionsevil_rare[WorldGen.genRand.Next(0, potionsevil_rare.Length)], 1.73), //Was going to use a jagged array but it was too buggy(Jagged Array is an Array of Arrays(int[][] JArray = {Array1, Array2, etc...}))
                        Tuple.Create(RandRare, .215),
                        Tuple.Create((int)ItemID.None, 17.0)
                    );
                    if (specialItem != ItemID.None)
                    {
                        itemsToAdd.Add((specialItem, 1));
                    }
                    else
                    {
                        if (WorldGen.genRand.NextBool())
                        {
                            itemsToAdd.Add((WorldGen.genRand.Next(5) != 5 ? commonItems[WorldGen.genRand.Next(0, commonItems.Length)] : potions_uncommon[WorldGen.genRand.Next(0, potions_uncommon.Length)], WorldGen.genRand.Next(9, 15)));
                            int Sel = WorldGen.genRand.Next(2) != 0 ? recall_bruh : ammo_common[WorldGen.genRand.Next(0, ammo_common.Length)];
                            itemsToAdd.Add((Sel, Sel == recall_bruh ? WorldGen.genRand.Next(1, 4) : WorldGen.genRand.Next(18, 34)));
                        }
                        else
                        {
                            int ForTenaryStatment = other1_common[WorldGen.genRand.Next(0, other1_common.Length)];
                            int otherSelected = WorldGen.genRand.Next(5) != 5 ? ForTenaryStatment : other2_common[WorldGen.genRand.Next(0, other2_common.Length)];
                            itemsToAdd.Add((otherSelected, otherSelected == ForTenaryStatment ? WorldGen.genRand.Next(2, 7) : WorldGen.genRand.Next(9, 15)));
                        }
                    }

                    int chestItemIndex = 0;
                    foreach (var itemToAdd in itemsToAdd)
                    {
                        Item item = new Item();
                        item.SetDefaults(itemToAdd.type);
                        item.stack = itemToAdd.stack;
                        chest.item[chestItemIndex] = item;
                        chestItemIndex++;
                        if (chestItemIndex >= 40)
                            break;
                    }
                }
                ShrineAmount--;
            }
        }



